import React from 'react'
import styled from 'styled-components'
import { Header } from '../main-pages/header'

const Container = styled.div`
  width: 100%;
`
const HeaderWrapper = styled.div`
  height: 100px;
  width: 1280px;
  align-items: center;
  display: flex;
  justify-content: space-between;
`

const LogoWrapper = styled.div`
  align-items: center;
  display: flex;
  justify-content: center;
  gap: 16px;
`

const Logo = styled.span``

const Title = styled.span`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 28px;
`

const ButtonWrapper = styled.div`
  gap: 36px;
  align-items: center;
  display: flex;
  justify-content: space-between;
`

const Button = styled.div``

const Navigator = styled.a`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 168px;
  height: 48px;
  border: 1px solid #5500dd;
  background-color: #ffffff;
  border-radius: 16px;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 16px;
  color: #5500dd;
  text-decoration: none;
`

const BodyContainer = styled.div`
  display: flex;
  justify-content: space-between;
  margin: 0 auto;
  width: 1280px;
  height: 800px;
`

const Body = styled.div`
  margin-left: 100px;
  text-align: left;
`

const BodyImg = styled.div`
  margin-right: 100px;
  display: flex;
  align-items: flex-end;
`

const BodyTitle = styled.div`
  margin-top: 260px;
  text-align: left;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 48px;
  line-height: 60px;
  color: #000000;
`

const BodyTitleBold = styled.text`
  ffont-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 48px;
  line-height: 60px;
`

const BodySubTitle = styled.div`
  margin-top: 24px;
  text-align: left;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 24px;
  line-height: 32px;
  color: #797a7b;
`

const SubButton = styled.button`
  margin-top: 64px;
  width: 168px;
  height: 48px;
  background: #5500dd;
  border-radius: 16px;
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 16px;
  color: #ffffff;
  border: none;
`

export const Location = () => {
  return (
    <Container>
      <Header />

      <BodyContainer>
        123
        <Body>
          <BodyTitle>
            교회생활의 <BodyTitleBold>편리함</BodyTitleBold>,
            <br />
            <BodyTitleBold>주다</BodyTitleBold>에서 찾아보세요
          </BodyTitle>
          <BodySubTitle>
            교회의 새로운 소식을 <br />
            빠르고 편리하게 확인할 수 있어요!
          </BodySubTitle>
          <SubButton>교회 제휴 문의</SubButton>
        </Body>
        <BodyImg>
          <img width="360px" src="/source/main_01.png" alt="main01 image"></img>
        </BodyImg>
      </BodyContainer>
    </Container>
  )
}
